import React, { useRef } from "react";
import { useGLTF } from "@react-three/drei";

export function Hercules(props) {
  const { nodes, materials } = useGLTF("/hercules.glb");
  return (
    <group {...props} dispose={null}>
      <group position={[0, 0, 0.02]}>
        <primitive object={nodes.root} />
        <primitive object={nodes.root027L001L001} />
        <primitive object={nodes.root018L001L} />
        <primitive object={nodes.root033L001L} />
        <primitive object={nodes.root027L001R001} />
        <primitive object={nodes.root018L001R} />
        <primitive object={nodes.root033L001R} />
        <skinnedMesh
          geometry={nodes.hair05.geometry}
          material={materials.hair05}
          skeleton={nodes.hair05.skeleton}
        />
        <skinnedMesh
          geometry={nodes.bighoneLP.geometry}
          material={materials.beetle_final}
          skeleton={nodes.bighoneLP.skeleton}
        />
      </group>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cylinder.geometry}
        material={materials.Material}
        position={[0, -6.19, -0.02]}
        rotation={[0, 0, -0.73]}
      />
    </group>
  );
}

useGLTF.preload("/hercules.glb");
